import React from "react";
import {NumberRow, NumberColumn} from "./NumberPositions";
import AtomicElement from "./ElementRepresentation";
import ElementLegend from "./ElementLegend";
import DetailedElement from "./DetailedElement";


class PeriodicTable extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {		
        return (
            <div>
                <AtomicElement type="nonmetal" atomicNumber="1" atomicWeight="1.008" elementName="hydrogen" symbol="H" />
                <AtomicElement type="alkali" atomicNumber="3" atomicWeight="6.490" elementName="lithium" symbol="Li" />
                <DetailedElement />
            </div>
        );
    }
}

export default PeriodicTable
